webpackJsonp([26986410390407],{"./node_modules/json-loader/index.js!./.cache/json/cropping-pdfs-html.json":function(e,a){e.exports={data:{markdownRemark:{html:'<p>I’m back again after a while with some new help for manipulating those annoying PDF files.</p>\n<p>If you’re a Student like I am then you will have probably come across when your professors make their class material available to download as a PDF. These tend to be Powerpoint slides that have been exported as a PDF, now I don’t know the reasoning but sometimes you find that the PDF you’ve been provided with has multiple Powerpoint slides on each page of the PDF. If you’ve never come across this then you may be wondering what could be wrong with that, well it makes visualizing them on smaller screens like tablets quite annoying, what you want is to have one slide for each page and then by default what you view will be resized in a readable manner.</p>\n<p>So, how do you get around this? It’s actually really simple thanks to an open source program called Briss.</p>\n<p>How does it work? well once you download Briss, from the link provided at the end of this page, you unzip it and then execute the program directly without having to install it.</p>\n<p>Next you click on “File”, “Load File” and then browse to the PDF you want to crop. A pop up will appear asking about “Enter pages to be excluded from merging” just hit cancel to load the whole PDF.\nOnce it has opened the PDF you’ll be presented with what makes this program so powerful yet easy to use.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 74.3103448275862%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/markholland.github.io/static/6b4fbfa988bf6a74c86d17d80278edc0-7ee4f.png"\n        srcset="/markholland.github.io/static/6b4fbfa988bf6a74c86d17d80278edc0-785d5.png 148w,\n/markholland.github.io/static/6b4fbfa988bf6a74c86d17d80278edc0-2f066.png 295w,\n/markholland.github.io/static/6b4fbfa988bf6a74c86d17d80278edc0-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>What you should see is one or multiple pages of the PDF with some blue boxes over the text, don’t worry if the text looks scrambled behind the blue boxes.</p>\n<p>Now how this works is you drag and resize the blue boxes over the content that you want to make up a page, you can create more blue boxes by just clicking then dragging where there isn’t already a blue box. This allows you to also divide single slides into multiple pages.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75.17241379310344%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/markholland.github.io/static/01417e89ee543b82ac61c1287e400964-7ee4f.png"\n        srcset="/markholland.github.io/static/01417e89ee543b82ac61c1287e400964-785d5.png 148w,\n/markholland.github.io/static/01417e89ee543b82ac61c1287e400964-2f066.png 295w,\n/markholland.github.io/static/01417e89ee543b82ac61c1287e400964-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Once you have the blue boxes sorted you can either preview the changes or save the cropped PDF using the “Action” tab of the program.</p>\n<p>And that’s it, hopefully you will find this useful.</p>\n<p><a href="http://sourceforge.net/projects/briss/">DOWNLOAD BRISS</a></p>',frontmatter:{date:"November 09, 2012",path:"/cropping-pdfs.html",tags:["tag"],title:"Cropping PDF files",image:{childImageSharp:{resize:{src:"/markholland.github.io/static/4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"To round off  2012  I’m going to finally get around to mentioning an amazing project I stumbled across several years ago. Kolibri OS  is an x86 Operating System, it comes with over 200 programs covering file managers, calculator, calendar...",html:'<p>To round off <strong>2012</strong> I’m going to finally get around to mentioning an amazing project I stumbled across several years ago.</p>\n<p><strong>Kolibri OS</strong> is an x86 Operating System, it comes with over 200 programs covering file managers, calculator, calendar, performance monitors, gpu stress tests, web browser, irc client, ftp clients and servers, word processor, mp3 player, 3D games like doom and quake, DOSbox, ZX spectrum, NES and scummvm emulators, the list is pretty big.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.20689655172414%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/markholland.github.io/static/ac088a61aab50982452d9f728a48f68a-7ee4f.png"\n        srcset="/markholland.github.io/static/ac088a61aab50982452d9f728a48f68a-785d5.png 148w,\n/markholland.github.io/static/ac088a61aab50982452d9f728a48f68a-2f066.png 295w,\n/markholland.github.io/static/ac088a61aab50982452d9f728a48f68a-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Now you thinking “but any linux distro has all this and more!” and you’d be right but Kolibris OS is very different.</p>\n<center><b>Kolibri OS is written entirely in Assembler code.</b></center>\n<p>Now once you get over how ludicrous that sounds I can start mentioning why on earth you would do this.</p>\n<p>Well for starters the entire OS with those 200 programs fits on a Floppy disk, the entire download with installers and a plethora of skins is only 3.4MB!</p>\n<p>I’m running it off a USB flash drive on a 10 year old <strong>500Mhz pentium III</strong> and it boots in 2 seconds, I’m not joking, once the post screen shows up it is literally 2 seconds until <strong>Kolibri</strong> is completely booted and ready to go, then opening any program is instant.</p>\n<p>I could spend hours gushing over this marvel but the only way you’ll understand where I’m coming from is by trying it out for yourself. So here are some brief steps to get you started running <strong>Kolibri OS</strong> from a USB flash drive by using windows 32 bit.</p>\n<ol>\n<li>\n<p>Download <strong>Kolibri OS</strong> from their website, <a href="http://kolibrios.org/en/">http://kolibrios.org/en/</a> you’re going to want to grab the <strong>Floppy disk image.</strong></p>\n</li>\n<li>\n<p>Prepare a <strong>USB</strong> flash drive that is formatted to fat32.</p>\n</li>\n<li>\n<p>Extract the downloaded .7z archive and navigate to “kolibri<em>0.7.7.0</em>img<em>enHD</em>loadUSB_Boot” and run <strong>“inst.exe”</strong> a window will open listing drive letters, double click the letter that is your flash drive and pop up will show up if the process was successful.</p>\n</li>\n<li>\n<p>Copy the file “BOOT<em>F32.BIN” and “kolibri.img”(situated in “kolibri</em>0.7.7.0<em>img</em>en”  to the pen drive and you’re good to go!</p>\n</li>\n<li>\n<p>Restart and boot from the flash drive and prepare to be impressed by <strong>Kolibri OS.</strong></p>\n</li>\n</ol>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2012-12-23-kolibri-os/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2012-12-23T12:00:00+00:00",path:"/kolibri-os.html",tags:["tag"],title:"Kolibri OS"}},next:{excerpt:"GSOC is officially over, you can check out what my mentor thinks  here . Next step, support and finishing those annoying last bits that were beyond me at the time.",html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="pandroid icon"\n        title=""\n        src="/markholland.github.io/static/55a16a07f6632096a06e6c2e7f8357f9-adfc8.png"\n        srcset="/markholland.github.io/static/55a16a07f6632096a06e6c2e7f8357f9-b4fb9.png 148w,\n/markholland.github.io/static/55a16a07f6632096a06e6c2e7f8357f9-ab48e.png 295w,\n/markholland.github.io/static/55a16a07f6632096a06e6c2e7f8357f9-adfc8.png 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  </p>\n<p>GSOC is officially over, you can check out what my mentor thinks <a href="http://blog.pandorafms.org/?p=605">here</a>.</p>\n<p>Next step, support and finishing those annoying last bits that were beyond me at the time.</p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2012-09-17-phase-one-complete/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2012-09-17T12:00:00+00:00",path:"/phase-one-complete",tags:["tag"],title:"Phase one complete"}}}}}});
